import React , { useState } from 'react';





const Meal=()=>{
  const [mealData, setmealData] = useState(null);

  
  
    fetch(
        'https://api.spoonacular.com/recipes/findByNutrients?minCarbs=10&maxCarbs=50&number=2&apiKey=a9b075e6656c45f587b86cba1c8c3789'
      )
        .then((response) => response.json())
        .then((data) => {
          setmealData(data[0].title)
        })
        .catch(() => {
          console.log("error");
        });


 
  return (
    <div>
      {mealData}
    </div>
  )
}
export default Meal;
